            JSON '{"class": {"students": [[{"name": "John"}], {"name": "Jamie"}]}}',
            'lax $.class[0].students[0].name') AS student_names_lax,
    JSON_QUERY(
            JSON '{"class": {"students": [[{"name": "John"}], {"name": "Jamie"}]}}',
            'lax recursive $.class[0].students[0].name') AS student_names_lax_recursive;

--expected
SELECT JSon_Extract(JSON '{"class": {"students": [[{"name": "John"}], {"name": "Jamie"}]}}', 'lax $.class[0].students[0].name') AS student_names_lax, JSon_Extract(JSON '{"class": {"students": [[{"name": "John"}], {"name": "Jamie"}]}}', 'lax recursive $.class[0].students[0].name') AS student_names_lax_recursive

--output
"student_names_lax","student_names_lax_recursive"
"JSQL_NULL","JSQL_NULL"

--result
